import React, { useState } from 'react';
import { useLocation } from 'react-router-dom';
import './OrderDetails.css';

function OrderDetails() {
  const location = useLocation();
  const cartItems = location.state?.cart?.items || [];
  
  const [tip, setTip] = useState('');
  const [userLocation, setUserLocation] = useState('');
  const [wearing, setWearing] = useState('');
  const [instructions, setInstructions] = useState('');

  const deliveryFee = 2.00;
  const taxRate = 0.086; // 8.6%

  const calculateSubtotal = () => {
    return cartItems.reduce((total, item) => total + item.total, 0);
  };

  const calculateTax = () => {
    return calculateSubtotal() * taxRate;
  };

  const calculateTotal = () => {
    const subtotal = calculateSubtotal();
    const tax = calculateTax();
    const tipAmount = parseFloat(tip) || 0;
    return subtotal + tax + deliveryFee + tipAmount;
  };

  const handleShareLocation = () => {
    // Implement geolocation functionality
    if (navigator.geolocation) {
      navigator.geolocation.getCurrentPosition((position) => {
        setUserLocation(`Lat: ${position.coords.latitude}, Long: ${position.coords.longitude}`);
      });
    }
  };

  return (
    <div className="order-details-page">
      <h1>Food and Drink Order</h1>
      <p className="subtitle">
        Give us the details of where to find you, and we'll make sure you get your order asap.
      </p>

      <div className="order-section">
        <h2>Your Order:</h2>
        {cartItems.map((item, index) => (
          <div key={index} className="order-item">
            <span className="item-name">{item.name}</span>
            <span className="item-price">${item.price.toFixed(2)}</span>
          </div>
        ))}

        <div className="order-summary">
          <div className="summary-item">
            <span>Subtotal</span>
            <span>${calculateSubtotal().toFixed(2)}</span>
          </div>
          <div className="summary-item">
            <span>Sales Tax (8.6%)</span>
            <span>${calculateTax().toFixed(2)}</span>
          </div>
          <div className="summary-item">
            <span>Delivery Fee</span>
            <span>${deliveryFee.toFixed(2)}</span>
          </div>
          <div className="summary-item">
            <span>Tip:</span>
            <input
              type="number"
              placeholder="Enter tip amount"
              value={tip}
              onChange={(e) => setTip(e.target.value)}
              className="tip-input"
            />
          </div>
          <div className="total">
            <span>Total</span>
            <span>${calculateTotal().toFixed(2)}</span>
          </div>
        </div>
      </div>

      <div className="location-section">
        <h2>Your Location:</h2>
        <div className="location-input">
          <input
            type="text"
            placeholder="e.g., Hole 7, near the bunker"
            value={userLocation}
            onChange={(e) => setUserLocation(e.target.value)}
          />
          <button onClick={handleShareLocation} className="share-location-btn">
            📍Share my location
          </button>
        </div>
      </div>

      <div className="wearing-section">
        <h2>What You're Wearing:</h2>
        <input
          type="text"
          placeholder="e.g., Red shirt, khaki shorts"
          value={wearing}
          onChange={(e) => setWearing(e.target.value)}
        />
      </div>

      <div className="instructions-section">
        <h2>Additional Instructions:</h2>
        <textarea
          placeholder="Any special instructions for delivery..."
          value={instructions}
          onChange={(e) => setInstructions(e.target.value)}
        />
      </div>

      <div className="payment-section">
        <div className="payment-info">
          <span>Payment Method: Visa ending in 1234</span>
          <button className="edit-payment">Edit</button>
        </div>
      </div>

      <button className="place-order-btn">Place Order</button>
    </div>
  );
}

export default OrderDetails;
